import React from 'react';
import styled from 'styled-components';
import { 
  BsSearch, 
  BsBarChart, 
  BsGear, 
  BsFileText,
  BsFilter,
  BsSave,
  BsTrash 
} from 'react-icons/bs';

// Estilizando os componentes do react-icons diretamente
const StyledSearch = styled(BsSearch)`
  font-size: 1.2rem;
`;

const StyledChart = styled(BsBarChart)`
  font-size: 1.2rem;
`;

const StyledGear = styled(BsGear)`
  font-size: 1.2rem;
`;

const StyledFile = styled(BsFileText)`
  font-size: 1.2rem;
`;

const StyledFilter = styled(BsFilter)`
  font-size: 1.2rem;
`;

const StyledSave = styled(BsSave)`
  font-size: 1.2rem;
`;

const StyledTrash = styled(BsTrash)`
  font-size: 1.2rem;
`;

// Exportando os componentes estilizados
export const SearchIcon = StyledSearch;
export const ChartIcon = StyledChart;
export const GearIcon = StyledGear;
export const FileIcon = StyledFile;
export const FilterIcon = StyledFilter;
export const SaveIcon = StyledSave;
export const TrashIcon = StyledTrash;
